import React from 'react';

import loader from './i'

const ListingDisplay = (props) => {

    const renderData = ({listData}) => {
        if(listData){
            if(listData.length > 0){
                return listData.map((item) => {
                    return(
                        <>
                        <p>data found</p>
                        </>
                    )
                })
            }
            else{
                return(
                    <h2>No Data Found</h2>
                )
            }
        }
        else{
            return(
                <div>
                    <img src='./images/loader.gif' alt=''/>
                    <h2>Loading......</h2>

                </div>
            )
        }
        
    }

    return(
        <>
           {renderData(props)}
        </>
    )
}

export default ListingDisplay;
